function getRequestParam() {
    var url = location.search;
    var theRequest = new Object();
    if (url.indexOf("?") != -1) {
        var str = url.substr(1);
        strs = str.split("&");
        for (var i = 0; i < strs.length; i++) {
            theRequest[strs[i].split("=")[0]] = unescape(strs[i].split("=")[1]);
        }
    }
    return theRequest;
}

function getAesKey(sBase64ed) {
    var dToday = new Date();
    var sToday = dToday.toLocaleDateString();
    var sBase64Parsed = CryptoJS.enc.Base64.parse(sBase64ed);
    const sBase64Plain = CryptoJS.enc.Utf8.stringify(sBase64Parsed);
    if (sBase64Plain.endsWith(sToday)) {
        var sAesKey = sBase64Plain.substr(0, sBase64Plain.length - 10);
        return sAesKey;
    }
    return null;

}

